define('text!views/shell.html',[],function () { return '<div>\n    <!-- Static navbar -->\n    <div class="navbar navbar-default navbar-static-top">\n      <div class="container">\n        <div class="navbar-header">\n          <button type="button" class="navbar-toggle" data-toggle="collapse" data-target=".navbar-collapse">\n            <span class="icon-bar">lkml</span>\n            <span class="icon-bar"></span>\n            <span class="icon-bar"></span>\n          </button>\n          <a class="navbar-brand">\n            <span>e-search</span>\n          </a>\n        </div>\n        <div class="navbar-collapse collapse">\n          <ul class="nav navbar-nav">\n            <li>\n              <div class="input-group" style="margin-top: 7px; width: 600px">\n                <input type="search" id="search" class="form-control" placeholder="What are you looking for today?">\n                <span class="input-group-addon glyphicon glyphicon-search"></span>\n              </div>\n            </li>\n          </ul>\n          <div class="loader pull-right" data-bind="css: { active: router.isNavigating }">\n            <i class="icon-spinner icon-2x icon-spin"></i>\n          </div>\n          <ul class="nav navbar-nav navbar-right">\n            <li class="dropdown">\n              <a href="#" class="dropdown-toggle" data-toggle="dropdown">Menu <b class="caret"></b></a>\n              <ul class="dropdown-menu" data-bind="foreach: router.navigationModel">\n                <!-- ko if: hash != \'#\' -->\n                <li data-bind="css: { active: isActive }">\n                    <a data-bind="attr: { href: hash }, html: title"></a>\n                </li>\n                <!-- /ko -->\n              </ul>\n            </li>\n          </ul>\n        </div><!--/.nav-collapse -->\n      </div>\n    </div>\n    <div id="filters" class="container">\n    </div>\n    \n    <div class="container page-host" data-bind="router: { transition:\'entrance\', cacheViews:true }"></div>\n</div>';});

